01393815a8d08b9e10661caac24c196b:
mutation useSignupMutation(
  $input: SignupInput!
) {
  signup(input: $input) {
    __typename
    ... on UserExistError {
      message
    }
    ... on MutationSignupSuccess {
      data {
        token
        user {
          username
          id
        }
      }
    }
  }
}

