mutation useLoginMutation(
  $input: LoginInput!
) {
  login(input: $input) {
    __typename
    ... on WrongCredentialsError {
      message
    }
    ... on MutationLoginSuccess {
      data {
        token
        user {
          username
          id
        }
      }
    }
  }
}
